import { AppBar, Box, Toolbar } from '@mui/material';
import MenuIcon from '@mui/icons-material/Menu';
import Logo from '../../assets/logo1';
import './styles.css';

export function Header() {
    return(
        <>
            <Box sx={{ display: 'flex' }}>
                <AppBar position='relative'>
                    <Toolbar 
                        sx={{ m: 2 }}
                    >
                        <MenuIcon fontSize='large'/>
                    </Toolbar>
                </AppBar>
            </Box>
        </>
    )
}
